import React from 'react';
import logo from './logo.svg';
import iphone from './ressources/iphonex.png';

import './App.css';
import Navbar from './Navbar';

export default class ProductPage extends React.Component{
    render(){
        return(
            <div style={{margin: 0}}>
                <Navbar/>
                <div class="border rounded" id="photo-frame">
                </div>
                <div class="border rounded" id="photo-frame2">
                </div>
            </div>
        )
    }
}
